// 상단바용 공용 UI
import React from 'react';
import { Link } from 'react-router-dom';

function NavBar(){
    return (
        <>
            <h1 align='center' style={{background: 'red'}}> InstaClone </h1>
            <nav>
            <Link to="/">홈</Link>
            <Link to="/about">소개</Link>
            <Link to="/contact">연락처</Link>
            </nav>

            <h4 style={{}}>
                2025 Blackwerf1257
            </h4>
        </>
      );
}

export default NavBar;
